PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "first_name" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "plataforma_examesc" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "exame_fisico" integer NOT NULL, "exames_complementares" integer NOT NULL, "diagnostico" integer NOT NULL, "plano_terapeutico" integer NOT NULL, "paciente_id" bigint NOT NULL REFERENCES "plataforma_pacientes" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "plataforma_dadospaciente" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "peso" integer NOT NULL, "qp" varchar(125) NOT NULL, "hma" varchar(125) NOT NULL, "hpp" varchar(125) NOT NULL, "antecedentepf" varchar(120) NOT NULL, "exames_complementares" varchar(80) NOT NULL, "diagnostico" varchar(80) NOT NULL, "plano_terapeutico" varchar(80) NOT NULL, "paciente_id" bigint NOT NULL REFERENCES "plataforma_pacientes" ("id") DEFERRABLE INITIALLY DEFERRED, "exame_fisico" varchar(88) NOT NULL, "data_dadospaciente" date NOT NULL);
CREATE TABLE IF NOT EXISTS "autenticacao_ativacao" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "token" varchar(64) NOT NULL, "ativo" bool NOT NULL, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "email" varchar(254) NOT NULL);
CREATE TABLE IF NOT EXISTS "autenticacao_perfilprofissional" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nome_completo" varchar(100) NOT NULL, "cpf" varchar(14) NOT NULL, "crefito" varchar(20) NOT NULL, "logotipo" varchar(100) NULL, "usuario_id" integer NOT NULL UNIQUE REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "nomeclinica" varchar(101) NULL);
CREATE TABLE IF NOT EXISTS "agenda_paciente" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nome" varchar(100) NOT NULL, "telefone" varchar(20) NOT NULL, "email" varchar(254) NOT NULL, "data_nascimento" date NOT NULL);
CREATE TABLE IF NOT EXISTS "plataforma_evolucao" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "titulo" varchar(50) NOT NULL, "imagem" varchar(100) NOT NULL, "evolucao" text NOT NULL, "paciente_id" bigint NOT NULL REFERENCES "plataforma_pacientes" ("id") DEFERRABLE INITIALLY DEFERRED, "data_criacao" date NOT NULL);
CREATE TABLE IF NOT EXISTS "plataforma_pacientes" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nome" varchar(50) NOT NULL, "sexo" varchar(24) NOT NULL, "estadocivil" varchar(25) NOT NULL, "datanascimento" date NOT NULL, "naturalidade" varchar(120) NOT NULL, "profissao" varchar(50) NOT NULL, "email" varchar(254) NOT NULL, "telefone" varchar(25) NOT NULL, "endereco" varchar(50) NOT NULL, "fisio_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "cpf" varchar(14) NULL);
CREATE TABLE IF NOT EXISTS "agenda_consulta" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "data_hora" datetime NOT NULL, "duracao" integer unsigned NOT NULL CHECK ("duracao" >= 0), "status" varchar(20) NOT NULL, "observacoes" text NOT NULL, "criado_em" datetime NOT NULL, "atualizado_em" datetime NOT NULL, "data_hora_fim" datetime NULL, "paciente_id" bigint NOT NULL REFERENCES "plataforma_pacientes" ("id") DEFERRABLE INITIALLY DEFERRED, "profissional_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "confirmado" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "notificacoes_aviso" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "titulo" varchar(150) NOT NULL, "mensagem" text NOT NULL, "criado_em" datetime NOT NULL, "automatico" bool NOT NULL, "enviar_email" bool NOT NULL, "enviar_whatsapp" bool NOT NULL, "primeira_vez_login" bool NOT NULL, "prioridade" varchar(10) NOT NULL);
CREATE TABLE IF NOT EXISTS "notificacoes_aviso_usuarios" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "aviso_id" bigint NOT NULL REFERENCES "notificacoes_aviso" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "notificacoes_avisousuario" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "lido" bool NOT NULL, "recebido_em" datetime NOT NULL, "aviso_id" bigint NOT NULL REFERENCES "notificacoes_aviso" ("id") DEFERRABLE INITIALLY DEFERRED, "usuario_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "paginas_vendas_assinatura" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "email" varchar(254) NOT NULL, "plano" varchar(50) NOT NULL, "validade" date NOT NULL, "status" varchar(20) NOT NULL, "data_pagamento" datetime NOT NULL, "eh_teste_gratis" bool NOT NULL, "valor" decimal NOT NULL);
