INSERT INTO plataforma_dadospaciente VALUES(13,82,'Dores nas costas','Mecanismo de lesão Problema lento ou súbito? Quais regiões corporais estão afetadas? Onde se localizava a dor ou outros sintomas no início do problema? Quais movimentos ou atividades causam dor? Há quanto tempo existe o problema? Já ocorrera antes?','tive uma hérnia de disco há 5 anos e fiz fisioterapia na época','Mãe com diagnóstico de osteoporose e artrose no joelho. Pai com histórico de hérnia de disco lombar. Irmão com escoliose diagnosticada na adolescência','Radiografia (Raio-X): → Exemplo: “Radiografia lombar mostra redução do espaço intervertebral em L4-L5.”  Ressonância Magnética: → Exemplo: “RM indica protrusão discal em L5-S1, com leve compressão da raiz','hosteoropse hereditaria','Reduzir dor em região lombar (meta: dor <3 na EVA em 4 semanas)  Melhorar amplitude de movimento lombar (flexão/extensão)  Reforçar musculatura abdominal e paravertebral  Corrigir padrão postural antálgico  Reeducar ergonomia no trabalho',7,'Postura em leve flexão anterior do tronco  Assimetria de cintura pélvica  Marcha antálgica (evita pisar com força no lado direito)','2025-04-30');
