INSERT INTO plataforma_dadospaciente VALUES(17,65,'qp1','O HMA VPN (HideMyAss!) é um software de rede virtual privada (VPN) projetado para garantir a privacidade e a segurança online dos usuários. Ele permite mascarar o endereço IP, criptografar a conexão à internet e acessar sites e conteúdos bloqueados por localização geográfica. Com uma interface intuitiva, o HMA oferece servidores em mais de 190 países, conexão rápida e recursos como Kill Switch, IP aleatório e proteção contra vazamentos de DNS. É amplamente utilizado para navegação anônima, segurança em redes Wi-Fi públicas e acesso a plataformas de streaming internacionais.  Se quiser uma versão mais técnica, resumida, formal ou adaptada a outro tipo de HMA, posso ajustar. Deseja isso para um trabalho acadêmico, site de vendas, projeto de TCC, ou outro uso específico?','hpp','Antecedentes Pessoais Familiares','exames complementares','diagnostico','plano terapuetico',1,'exame fisico','2025-05-12');
