INSERT INTO plataforma_evolucao VALUES(29,'dores nas costas','',replace(replace('Condutas realizadas:\r\n\r\nTerapia manual: liberação miofascial em região lombar direita e mobilização articular em L4-L5\r\n\r\nEletroterapia: TENS (modo burst) por 20 min – intensidade tolerável\r\n\r\nCinesioterapia: alongamento de cadeia posterior, ponte com elevação de quadril, prancha abdominal isométrica (3x 20 segundos)\r\n\r\nReeducação postural: treino em pé com espelho e feedback tátil\r\n\r\nResposta do paciente:\r\n\r\nRelatou redução da dor de 6 para 4 na escala EVA ao final da sessão\r\n\r\nExecutou os exercícios com leve desconforto, mas sem limitação funcional\r\n\r\nMelhor controle postural comparado à sessão anterior\r\n\r\nOrientações:\r\n\r\nReforçada a importância de pausas ativas no trabalho a cada 2 horas\r\n\r\nInstruído a realizar os alongamentos prescritos em casa, 1x/dia\r\n\r\nObservações:\r\n\r\nBoa adesão ao tratamento\r\n\r\nPlanejado início de exercícios com resistência leve na próxima sessão','\r',char(13)),'\n',char(10)),7,'2025-04-30');
